import React from "react";
import Note from "./Note";
import notes from "../notes";

/*
.map should be within <div></div>
input of map can have the same name of array
key should be included as ID in array
array should directly come from array file not the function input

*/
function Card(){
    return(
        <div>
        {notes.map(notes => {return(
        <Note
        key = {notes.key}
        title = {notes.title}
        content = {notes.content}
    /> )})
    }
        </div>
    )
}
export default Card;
